//import classes from './App.module.css'
import textInput from './TextInput'
import Layout from './layout/Layout';

class App extends Component {

  render() {
    return (
      <Layout>
        <textInput />
      <div>
        textInput
      </div>
      </Layout>
    )


  }

}




export default App;
